For &Column in &ColumnsSelector.Columns
	Do 'IsColumnVisible'
	If &Found
		&Column.IsVisible = &IsColumnVisible
	EndIf
EndFor

Sub 'IsColumnVisible'
	&Found = False
	For &ColumnAux in &OldColumnsSelector.Columns
		If &Column.ColumnName = &ColumnAux.ColumnName
			&IsColumnVisible = &ColumnAux.IsVisible
			&Found = True
			Exit
		EndIf
	EndFor
